import React from 'react';

const API_ID = "codingbootcamp";

class Events extends React.Component{
    state = {
        events: []
    }
    componentDidMount = async() =>{
        const title = this.props.location.state.artist;
        const req = await fetch
        (`https://rest.bandsintown.com/artists/${title}/events/?app_id=${API_ID}`); 
        const res = await req.json();
        console.log(res);


    }

    render(){

        return (
            <section id="steps" class="steps">
                <div class="container">

                    <h1 class= "number-of-events"></h1>
                    <h2>Event Details</h2>
                    <div id="final-events-display" class="row no-gutters" data-aos="fade-up">
                        <div class="event-info-display col-lg-12 col-md-6 content-item" data-aos="fade-up" data-aos-delay="100">
                        </div> 

                    </div>

                </div>
            </section>
        );
    }


}

export default Events;
